import java.util.HashMap;

/*
 * Given two strings s and t which consist of only lowercase letters. 
 * String t is generated by random shuffling string s and then add one more letter at a random position.
 * Find the letter that was added in t.
 */

public class Solution389 {
	public static void main(String[] args) {
		System.out.println(findTheDifference(
				"",
				""));
	}

	public static char findTheDifference(String s, String t) {
		char differentChar = 0;

		HashMap<Character, Integer> characterCount = new HashMap<>();

		for (int i = 0; i < s.length(); i++) {
			if (!characterCount.containsKey(s.charAt(i))) {
				characterCount.put(s.charAt(i), 0);
			}

			characterCount.put(s.charAt(i), characterCount.get(s.charAt(i)) + 1);
		}

		for (int i = 0; i < t.length(); i++) {
			if (!characterCount.containsKey(t.charAt(i))) {
				differentChar = t.charAt(i);
				break;
			}

			characterCount.put(t.charAt(i), characterCount.get(t.charAt(i)) - 1);
			if (characterCount.get(t.charAt(i)) == 0) {
				characterCount.remove(t.charAt(i));
			}
		}

		return differentChar;
	}
}
